import React from 'react';
import { Routes, Route, Router } from "react-router-dom";
import Productos from './componentes/Productos.jsx';
import Inicio from "./componentes/Inicio.jsx";
import IngresoDatos from './componentes/IngresoDatos.jsx';
import Carrito from './componentes/Carrito.jsx';
import Login from "./paginas/Login/Login.jsx";
import Register from "./paginas/Registro/register.jsx";
import { ShopContextProvider } from "./context/shop-context";
import { Cart } from './paginas/Cart/cart';
import { Shop } from './paginas/Shop/shop';
import { ShopAddtoCart } from "./paginas/ShopAddtoCart/shopAddtoCart";
import { Navbar } from "./componentes/navbar.jsx";

function App() {
  return (
    <div className="App">
      <ShopContextProvider>
        <Router>
          <Navbar />
          <Routes>
            <Route path="/inicio" element={ <Inicio /> } />
            <Route path="/shop" element={<ShopAddtoCart />}/>
            <Route path="/Productos" element={ <Productos /> } />
            <Route path="/" element={<Shop />}/>
            <Route path="/IngresoDatos" element={ <IngresoDatos/> } />
            <Route path="/Carrito" element={ <Carrito/> } />
            <Route path="/login" element={<Login />}/>
            <Route path="/register" element={<Register />}/>
            <Route path="/cart" element={<Cart />}/>
          </Routes>
        </Router>
      </ShopContextProvider> 
    </div>
  );
}

export default App;
